import React, { useState } from 'react';
import Search from './components/Search'


function App() {

  const [state, setState] = useState({
    s: "",
    results: [],
    selected: {}
  }); 
  const apiurl = "http://www.omdbapi.com/?apikey=fd25c2ed"
  const handleInput = (e) => {
    let s = e.target.value;

    setState(prevState => {
      return { ...prevState, s: s}
    });

    console.log(state.s);

  }
  console.log("start");

  return (
    <div className="App">
      <header>
        <h1>Movie Database</h1>
      </header>
      <main>
          <Search handleInput={handleInput}/>
      </main>
    </div>
  ); 
}

export default App;
